                <button style={{backgroundColor:'rgb(10, 33, 107)',color:'#fff'}} type="submit">submit</button>
            </form>
         </div>
         
         </div>
         </section>
         </section>
              
         </div>
           
       
    
  
   
    
    


    
 <footer style={{...styles.Footer}}>
    <p style={{...styles.FooterCopyRight}}>&copy; 2024 Your Company</p>
  </footer>

  </div>

    
  );
  
}

